import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    navButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
    },
}));

const NavBar = ({ isAuthenticated, isAdmin }) => {
    const classes = useStyles();

    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" className={classes.title}>
                    Mon Site de Recettes
                </Typography>
                <Button component={Link} to="/" color="inherit" className={classes.navButton}>Accueil</Button>
                {isAuthenticated ? (
                    <>
                        <Button component={Link} to="/profile" color="inherit" className={classes.navButton}>Profil</Button>
                        <Button component={Link} to="/logout" color="inherit" className={classes.navButton}>DÃ©connexion</Button>
                        {isAdmin && (
                            <Button component={Link} to="/admin" color="inherit" className={classes.navButton}>Admin</Button>
                        )}
                    </>
                ) : (
                    <>
                        <Button component={Link} to="/login" color="inherit" className={classes.navButton}>Connexion</Button>
                        <Button component={Link} to="/register" color="inherit" className={classes.navButton}>Inscription</Button>
                    </>
                )}
            </Toolbar>
        </AppBar>
    );
};

export default NavBar;
